import React, {Component} from 'react';
// import {} from "antd-mobile";
import './login.css'

class Login extends Component {
    render() {
        return (
            <div className={'login'}>
                <div className={'login_header'}>
                    <img src={require('../../common/images/logo.png')} alt=""/>
                    <h3>小米账号登录</h3>
                </div>
            </div>
        );
    }
}

export default Login;
